/*Data for the table `news` */

insert  into `news`(`NewsID`,`Title`,`UpdateTime`,`Content`,`isTop`) values (29,'西班牙洲际银行投资比特币交易所Coinffeine','2014-11-10 06:52:45','11月18日讯，西班牙洲际银行（Bankinter）宣布，他们投资了一个名为Coinffeine的去中化加密货币交易平台，该平台于今年6月份时上线，据银行一方透露，此轮融资的投资方为Bankinter旗下的创新基金。Coinffeine公司表示，目前具体融资金额无法透露，不过可以参考的是，Bankinter创新基金通常会投资初创企业2。5万－20万欧元。<br/><br/><br/>西班牙洲际银行简介<br/><br/>西班牙洲际银行是一家西班牙商业银行，2007年时成为西班牙第六大上市银行集团，该公司最大的单个股东为法国农业信贷银行，2007年末开始持有该公司20％的股份。2010年，该银行的净利润为1。507亿欧元，总资产为540。2亿欧元（2010年末）<br/><br/>Coinffeine是干什么的<br/><br/>Coinffeine是一家交易法币/比特币的匿名分布式交易平台，它的目的是让用户能够使用一种对等式（P2P）的方式交易比特币和法币。',1),(27,'西班牙洲际银行投资比特币交易所Coinffeine','2014-11-10 06:52:45','11月18日讯，西班牙洲际银行（Bankinter）宣布，他们投资了一个名为Coinffeine的去中化加密货币交易平台，该平台于今年6月份时上线，据银行一方透露，此轮融资的投资方为Bankinter旗下的创新基金。Coinffeine公司表示，目前具体融资金额无法透露，不过可以参考的是，Bankinter创新基金通常会投资初创企业2。5万－20万欧元。<br/><br/><br/>西班牙洲际银行简介<br/><br/>西班牙洲际银行是一家西班牙商业银行，2007年时成为西班牙第六大上市银行集团，该公司最大的单个股东为法国农业信贷银行，2007年末开始持有该公司20％的股份。2010年，该银行的净利润为1。507亿欧元，总资产为540。2亿欧元（2010年末）<br/><br/>Coinffeine是干什么的<br/><br/>Coinffeine是一家交易法币/比特币的匿名分布式交易平台，它的目的是让用户能够使用一种对等式（P2P）的方式交易比特币和法币。',0),(28,'西班牙洲际银行投资比特币交易所Coinffeine','2014-11-10 06:52:45','11月18日讯，西班牙洲际银行（Bankinter）宣布，他们投资了一个名为Coinffeine的去中化加密货币交易平台，该平台于今年6月份时上线，据银行一方透露，此轮融资的投资方为Bankinter旗下的创新基金。Coinffeine公司表示，目前具体融资金额无法透露，不过可以参考的是，Bankinter创新基金通常会投资初创企业2。5万－20万欧元。<br/><br/><br/>西班牙洲际银行简介<br/><br/>西班牙洲际银行是一家西班牙商业银行，2007年时成为西班牙第六大上市银行集团，该公司最大的单个股东为法国农业信贷银行，2007年末开始持有该公司20％的股份。2010年，该银行的净利润为1。507亿欧元，总资产为540。2亿欧元（2010年末）<br/><br/>Coinffeine是干什么的<br/><br/>Coinffeine是一家交易法币/比特币的匿名分布式交易平台，它的目的是让用户能够使用一种对等式（P2P）的方式交易比特币和法币。',0),(26,'的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的淡淡的','2014-11-10 06:52:45','11月18日讯，西班牙洲际银行（Bankinter）宣布，他们投资了一个名为Coinffeine的去中化加密货币交易平台，该平台于今年6月份时上线，据银行一方透露，此轮融资的投资方为Bankinter旗下的创新基金。Coinffeine公司表示，目前具体融资金额无法透露，不过可以参考的是，Bankinter创新基金通常会投资初创企业2。5万－20万欧元。<br/><br/><br/>西班牙洲际银行简介<br/><br/>西班牙洲际银行是一家西班牙商业银行，2007年时成为西班牙第六大上市银行集团，该公司最大的单个股东为法国农业信贷银行，2007年末开始持有该公司20％的股份。2010年，该银行的净利润为1。507亿欧元，总资产为540。2亿欧元（2010年末）<br/><br/>C